import React from 'react';
import './App.css';
import CoronaImage from './images/image.png'
import Tabular from './table/tabular';
import { fetchSummary } from './api/fetchApi'
import Summary from './summary/summary';
// import TableData from './table/TableData';

class App extends React.Component {

  state = {
    data: {},
    country: '',
  }

  async componentDidMount() {
    const fetchedData = await fetchSummary()
    this.setState({ data: fetchedData })
    //console.log(fetchedData)
  }


  // }
  //  { data: { Arunachal, Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } }

  //     const { data, country } = this.state;
  render() {
    const { data } = this.state;
    return (
      <>
        <img style={{ width: '220px', marginTop: '50px', marginBottom: '50px', justifyContent: 'center' }} src={CoronaImage} alt='Corona' />
        <Summary data={data} />
        <div className="container">
          {/* <img style={{ width: '220px', marginTop: '50px', marginBottom: '50px', justifyContent: 'center' }} src={CoronaImage} alt='Corona' /> */}
          <br></br>

          <Tabular />
        </div>
      </>
    );
  }
}

export default App;
